import React from 'react';
import map from './mapOfLocations.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={map} className="App-mapOfLocations" alt="mapOfLocations"/>
        <p>
          Select the companies you plan to visit:
          <select>
            <option value="grapefruit">Company1</option>
            <option value="lime">Company2</option>
            <option selected value="coconut">Company3</option>
            <option value="mango">Company4</option>
          </select>
        </p>
        <form>
          <label>
            <input type="text" name="name" />
          </label>
          <input type="submit" value="Submit" />
        </form>
      </header>

    </div>
  );
}

export default App;
